import React from 'react'
import '../style.css'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";


class ClientHeader extends React.Component {

    render() {

        //const { path, url } = useRouteMatch()

        return (
            <header>
                <div class="title title_small">
                    <h1>
                    Petz
                    </h1>
                </div>
                <div class="menu menuClient">
                    <ul>
                        <li class="dropdown">
                            <Link to={`${this.props.match.path}/agendamento`}>Agendamento</Link>
                            <div class="dropdown-content">
                                <a href="cliente_agendamento_banho.html">Banho/Tosa</a>
                                <a href="cliente_agendamento_consulta.html">Consulta</a>
                            </div>
                        </li>
                        <li><a href="cliente_produtos.html">Produtos</a></li>
                        <li><a href="cliente_adocao.html">Compre/Adote pets</a></li>
                        <li><a href="cliente_perfil.html">Meu perfil</a></li>
                        <li><a href="cliente_carrinho.html">Meu carrinho</a></li>
                    </ul>
                </div>
            </header>
        );
    }
}

export default ClientHeader;
